part 'widgets/collection_day_group.dart';

class CollectionData extends StatefulWidget {
  const CollectionData({super.key, required this.data});

  final TransferCardData data;

  @override
  State<CollectionData> createState() => _CollectionDataState();
}

class _CollectionDataState extends State<CollectionData> {
  late DateTimeRange _activeRange;
  late final List<CollectionDay> _allDays;

  @override
  void initState() {
    super.initState();
    final DateTime now = DateTime.now();
    _activeRange = DateTimeRange(
      start: now.subtract(const Duration(days: 6)),
      end: now,
    );
    _allDays = _createMockData(now);
  }

  @override
  Widget build(BuildContext context) {
    final List<CollectionDay> visibleDays = _filterDaysByRange();
    final double totalKg = _allDays.fold(
      0,
      (double total, CollectionDay day) => total + day.totalKg,
    );
    final double totalVisibleKg = visibleDays.fold(
      0,
      (double total, CollectionDay day) => total + day.totalKg,
    );

    return Scaffold(
      backgroundColor: ColorUtils.bgColor,
      body: Container(
        decoration: BoxDecoration(
          gradient: LinearGradient(
            begin: Alignment.topCenter,
            end: Alignment.bottomCenter,
            colors: [ColorUtils.scaffoldColor, Colors.white],
          ),
        ),
        child: Column(
          children: <Widget>[
            CustomAppBar(
              title: 'Collection Data',
              onBackPressed: () => Navigator.of(context).maybePop(),
            ),
            Expanded(
              child: ListView(
                physics: const BouncingScrollPhysics(),
                padding: const EdgeInsets.symmetric(
                  horizontal: 20,
                  vertical: 16,
                ),
                children: <Widget>[
                  _buildSummaryCard(totalKg),
                  const SizedBox(height: 18),
                  _buildDateRangeSelector(totalVisibleKg),
                  const SizedBox(height: 24),
                  if (visibleDays.isEmpty)
                    _buildEmptyState()
                  else
                    ...visibleDays.map(_DayGroup.new),
                ],
              ),
            ),
          ],
        ),
      ),
    );
  }

  Widget _buildSummaryCard(double totalKg) => Container(
    padding: const EdgeInsets.all(20),
    decoration: BoxDecoration(
      borderRadius: BorderRadius.circular(24),
      color: ColorUtils.whiteColor,
      boxShadow: const <BoxShadow>[
        BoxShadow(
          color: Color.fromRGBO(15, 23, 42, 0.08),
          blurRadius: 24,
          offset: Offset(0, 8),
        ),
      ],
    ),
    child: Column(
      crossAxisAlignment: CrossAxisAlignment.start,
      children: <Widget>[
        Text(
          widget.data.restaurantName,
          style: StyleUtils.kTextStyleSize20Weight600(
            color: ColorUtils.themeColor,
          ),
        ),
        const SizedBox(height: 4),
        Text(
          widget.data.restaurantAddress,
          style: StyleUtils.kTextStyleSize14Weight400(
            color: ColorUtils.greyTextColor,
          ),
        ),
        const SizedBox(height: 20),
        Container(
          padding: const EdgeInsets.all(16),
          decoration: BoxDecoration(
            borderRadius: BorderRadius.circular(20),
            color: ColorUtils.lightGreen,
          ),
          child: Row(
            children: <Widget>[
              Container(
                height: 48,
                width: 48,
                decoration: BoxDecoration(
                  shape: BoxShape.circle,
                  color: ColorUtils.themeColor.withValues(alpha: 0.1),
                ),
                child: const Icon(
                  CupertinoIcons.cube_box_fill,
                  color: ColorUtils.themeColor,
                ),
              ),
              const SizedBox(width: 16),
              Column(
                crossAxisAlignment: CrossAxisAlignment.start,
                children: <Widget>[
                  Text(
                    "Total Collected",
                    style: StyleUtils.kTextStyleSize14Weight500(
                      color: ColorUtils.greyTextColor,
                    ),
                  ),
                  Text(
                    Utils.replaceFarsiNumber(
                      "${totalKg.toStringAsFixed(1)} KG",
                    ),
                    style: StyleUtils.kTextStyleSize24Weight700(
                      color: ColorUtils.darkGreen,
                    ),
                  ),
                ],
              ),
            ],
          ),
        ),
      ],
    ),
  );

  Widget _buildDateRangeSelector(double totalKg) {
    final DateFormat formatter = DateFormat(
      'MMM dd',
      TranslationService.getLocale().toString(),
    );
    final String rangeText =
        "${formatter.format(_activeRange.start)} - ${formatter.format(_activeRange.end)}";
    return GestureDetector(
      onTap: _pickDateRange,
      child: Container(
        padding: const EdgeInsets.symmetric(horizontal: 16, vertical: 18),
        decoration: BoxDecoration(
          borderRadius: BorderRadius.circular(18),
          gradient: const LinearGradient(
            colors: <Color>[ColorUtils.themeColor, Color(0xFF1E8F87)],
          ),
          boxShadow: const <BoxShadow>[
            BoxShadow(
              color: Color.fromRGBO(17, 24, 39, 0.18),
              blurRadius: 18,
              offset: Offset(0, 8),
            ),
          ],
        ),
        child: Row(
          children: <Widget>[
            Container(
              height: 44,
              width: 44,
              decoration: BoxDecoration(
                borderRadius: BorderRadius.circular(14),
                color: Colors.white.withValues(alpha: 0.15),
              ),
              child: const Icon(
                CupertinoIcons.calendar_today,
                color: Colors.white,
              ),
            ),
            const SizedBox(width: 14),
            Expanded(
              child: Column(
                crossAxisAlignment: CrossAxisAlignment.start,
                children: <Widget>[
                  Text(
                    "Date range",
                    style: StyleUtils.kTextStyleSize12Weight500(
                      color: Colors.white.withValues(alpha: 0.8),
                    ),
                  ),
                  Text(
                    Utils.replaceFarsiNumber(rangeText),
                    style: StyleUtils.kTextStyleSize18Weight600(
                      color: Colors.white,
                    ),
                  ),
                ],
              ),
            ),
            Text(
              Utils.replaceFarsiNumber("${totalKg.toStringAsFixed(1)} KG"),
              style: StyleUtils.kTextStyleSize24Weight700(
                color: ColorUtils.whiteColor,
              ),
            ),
            10.widthBox,
            const Icon(CupertinoIcons.chevron_down, color: Colors.white),
          ],
        ),
      ),
    );
  }

  Widget _buildEmptyState() => Container(
    padding: const EdgeInsets.symmetric(horizontal: 24, vertical: 36),
    decoration: BoxDecoration(
      borderRadius: BorderRadius.circular(24),
      color: ColorUtils.whiteColor,
      border: Border.all(color: ColorUtils.borderColor),
    ),
    child: Column(
      children: <Widget>[
        Icon(
          CupertinoIcons.calendar_badge_plus,
          size: 48,
          color: ColorUtils.themeColor,
        ),
        const SizedBox(height: 18),
        Text(
          "No collections in this range",
          style: StyleUtils.kTextStyleSize18Weight600(),
          textAlign: TextAlign.center,
        ),
        const SizedBox(height: 8),
        Text(
          "Pick another date range to view collected KG records grouped by day.",
          style: StyleUtils.kTextStyleSize14Weight400(
            color: ColorUtils.greyTextColor,
          ),
          textAlign: TextAlign.center,
        ),
      ],
    ),
  );

  List<CollectionDay> _filterDaysByRange() {
    final DateTime start = _startOfDay(_activeRange.start);
    final DateTime end = _startOfDay(_activeRange.end);
    return _allDays.where((CollectionDay day) {
      final DateTime date = _startOfDay(day.date);
      final bool isAfterStart =
          date.isAfter(start) || date.isAtSameMomentAs(start);
      final bool isBeforeEnd = date.isBefore(end) || date.isAtSameMomentAs(end);
      return isAfterStart && isBeforeEnd;
    }).toList()..sort(
      (CollectionDay a, CollectionDay b) => b.date.compareTo(a.date),
    );
  }

  DateTime _startOfDay(DateTime date) =>
      DateTime(date.year, date.month, date.day);

  Future<void> _pickDateRange() async {
    final DateTimeRange? picked = await showDateRangePicker(
      context: context,
      initialDateRange: _activeRange,
      firstDate: DateTime.now().subtract(const Duration(days: 365)),
      lastDate: DateTime.now(),
      builder: (BuildContext context, Widget? child) {
        // Slightly tint the picker to match the brand color.
        return Theme(
          data: Theme.of(context).copyWith(
            colorScheme: const ColorScheme.light(
              primary: ColorUtils.themeColor,
            ),
          ),
          child: child ?? const SizedBox.shrink(),
        );
      },
    );

    if (picked != null) {
      setState(() => _activeRange = picked);
    }
  }

  List<CollectionDay> _createMockData(DateTime anchor) {
    final DateTime today = _startOfDay(anchor);
    final DateTime yesterday = today.subtract(const Duration(days: 1));
    final DateTime twoDaysAgo = today.subtract(const Duration(days: 2));

    return <CollectionDay>[
      CollectionDay(
        date: today,
        entries: <CollectionEntry>[
          CollectionEntry(
            collectedFrom: "Aisha Khan",
            collectedKg: 18.4,
            timestamp: today.add(const Duration(hours: 9, minutes: 35)),
            driverName: "Imran R.",
            signBytes:
                '''data:image/jpeg;base64,''',
          ),
          CollectionEntry(
            collectedFrom: "Paul Munroe",
            collectedKg: 11.2,
            timestamp: today.add(const Duration(hours: 12, minutes: 10)),
            driverName: "Hannah V.",

            signBytes:
                '''data:image/jpeg;base64,''',
          ),
          CollectionEntry(
            collectedFrom: "Sana Raj",
            collectedKg: 9.8,
            timestamp: today.add(const Duration(hours: 16, minutes: 5)),
            driverName: "Imran R.",

            signBytes:
                '''data:image/jpeg;base64,''',
          ),
        ],
      ),
      CollectionDay(
        date: yesterday,
        entries: <CollectionEntry>[
          CollectionEntry(
            collectedFrom: "Omar Al Farsi",
            collectedKg: 15.0,
            timestamp: yesterday.add(const Duration(hours: 10, minutes: 50)),
            driverName: "Sara M.",

            signBytes:
                '''data:image/jpeg;base64,''',
          ),
          CollectionEntry(
            collectedFrom: "Paola Garcia",
            collectedKg: 7.6,
            timestamp: yesterday.add(const Duration(hours: 14, minutes: 20)),
            driverName: "Sara M.",

            signBytes:
                '''data:image/jpeg;base64,''',
          ),
        ],
      ),
      CollectionDay(
        date: twoDaysAgo,
        entries: <CollectionEntry>[
          CollectionEntry(
            collectedFrom: "Lee Wong",
            collectedKg: 12.9,
            timestamp: twoDaysAgo.add(const Duration(hours: 11, minutes: 15)),
            driverName: "Benjamin K.",

            signBytes:
                '''data:image/jpeg;base64,''',
          ),
          CollectionEntry(
            collectedKg: 17.3,
            timestamp: twoDaysAgo.add(const Duration(hours: 17, minutes: 40)),
            driverName: "Benjamin K.",
            collectedFrom: "Supervisor Juan",
            signBytes:
                '''data:image/jpeg;base64,''',
          ),
        ],
      ),
    ];
  }
}

class CollectionDay {
  const CollectionDay({required this.date, required this.entries});

  final DateTime date;
  final List<CollectionEntry> entries;

  double get totalKg =>
      entries.fold(0, (double sum, CollectionEntry e) => sum + e.collectedKg);
}

class CollectionEntry {
  const CollectionEntry({
    required this.driverName,
    required this.collectedFrom,
    required this.timestamp,
    required this.collectedKg,
    required this.signBytes,
  });

  final String driverName;
  final DateTime timestamp;
  final double collectedKg;
  final String collectedFrom;
  final String signBytes;
}
